import React, { useState, useEffect } from "react";
import "../styles/slider.scss"; // 슬라이더 스타일 적용
import "../styles/TextTyping.scss"; // SCSS 파일 연결

function Home() {
  return (
    <div className="Home">
      <Head />
      <Nav />      
      <Routes>
         <Route path ='/' element ={<Home />} />
         <Route path ='/Cuticle' element ={<Cuticle />} />
         <Route path ='/Handcream' element ={<Handcream />} />
         <Route path ='/Nailhardener' element ={<Nailhardener />} />
         <Route path ='/Nailserum' element ={<Nailserum />} />
         <Route path ='/Guestbook' element ={<Guestbook />} />
      </Routes>
      <Slider />      
      <TextTyping />     
     <Footer />       
    </div>
  );
}

export default Home;
